import React, { useState } from 'react';
import './Navbar.css';
import { Link } from 'react-router-dom';

export default function Navbar() {
    const [isOpen, setIsOpen] = useState(false);

    const toggleNav = () => {
        setIsOpen(!isOpen); // Toggle the nav visibility when screen shrinks
    };

    const closeNav = () => {
        setIsOpen(false); // Close the nav when a hamburger is clicked
    };

    return (
        <>
            {/* Hamburger Button outside of the nav */}
            <div className="hamburger" onClick={toggleNav}>
                <span></span>
                <span></span>
                <span></span>
            </div>

            {/* Navbar container */}
            <nav className={`nav ${isOpen ? 'open' : ''}`}>
                <div className="header">
                    {/* <img src={} className="logo" alt="Logo" /> */}
                    <div className="site-title">Health Portal</div>
                </div>
                <ul>
                    <li>
                        <Link to='/Profile' onClick={closeNav}>Profile</Link>
                    </li>
                </ul>
            </nav>
        </>
    );
}
